const WAYPOINT_FORMAT = `
    $[ICON]
    <div>$[LABEL]</div>
    <div class="distance"></div>
`

let Waypoints = [];

function UpdateWaypointPosition(index, scaleX, scaleY, distanceText) {
    let waypoint = GetWaypoint(index);
    if (waypoint == null) return;
    let element = waypoint.element;
    element.style.display = "flex";
    element.getElementsByClassName("distance")[0].innerHTML = distanceText;
    let width = window.innerWidth;
    let height = window.innerHeight;
    let positionInfo = element.getBoundingClientRect();
    let offsetWidth = positionInfo.width;
    let offsetHeight = positionInfo.height;
    element.style.left = ((width - offsetWidth) * scaleX) + "px";
    element.style.top = ((height - offsetHeight) * scaleY) + "px";
}

function GetWaypoint(index) {
    for (let i = 0; i < Waypoints.length; i++) {
        if (Waypoints[i].index == index) {
            return Waypoints[i];
        }
    }
    return null;
}

function GetWaypointArrayIndex(index) {
    for (let i = 0; i < Waypoints.length; i++) {
        if (Waypoints[i].index == index) {
            return i;
        }
    }
    return null;
}

function GetWaypointImage(icon) {
    let path = "assets/images/" + icon + ".png";
    if (icon.includes("http")) {
        path = icon;
    }
    return `
        <img src="${path}"/>
    `

}

function GetWaypointSVG(color) {
    let svg = WAYPOINT_SVG;
    svg = svg.replace("$[COLOR]", "rgba("+ color[0] + ", " + color[1] + ", " + color[2] + ", "+ (color[3] / 255) +")");
    return svg;
}

function AddWaypoint(index, label, icon, color) {
    let waypointHtml = WAYPOINT_FORMAT;
    waypointHtml = waypointHtml.replace("$[ICON]", icon ? GetWaypointImage(icon) : GetWaypointSVG(color));
    waypointHtml = waypointHtml.replace("$[LABEL]", label);
    let element = document.createElement("div");
    element.style.display = "none";
    element.className = "waypoint";
    element.innerHTML = waypointHtml;
    document.getElementsByClassName("waypoints-container")[0].appendChild(element);
    Waypoints.push({ index: index, icon: icon, label: label, element: element });
}

function RemoveWaypoint(index) {
    let id = GetWaypointArrayIndex(index);
    if (id == null) return;
    let waypoint = Waypoints[id];
    waypoint.element.remove();
    Waypoints = Waypoints.filter(x => x.index != index);
}

function UpdateWaypointSettings(index, icon, color) {
    let id = GetWaypointArrayIndex(index);
    if (id == null) return;
    let waypoint = Waypoints[id];
    RemoveWaypoint(index)
    AddWaypoint(index, waypoint.label, icon, color)
}

function UILoaded() {
}


window.addEventListener("message", function(ev) {
    var event = ev.data
    if (event.type == "addWaypoint") {
        AddWaypoint(event.index, event.label, event.icon, event.color);
    }
    if (event.type == "removeWaypoint") {
        RemoveWaypoint(event.index);
    }
    if (event.type == "updateWaypointSettings") {
        UpdateWaypointSettings(event.index, event.icon, event.color);
    }
    if (event.type == "updateWaypointPosition") {
        UpdateWaypointPosition(event.index, event.scaleX, event.scaleY, event.distanceText);
    }
})